export default {
  title: 'Wan Rules settings schema',
  type: 'object',
  properties: {
    action: {
      type: 'object',
      properties: {
        type: { type: 'string' },
        policy: { type: 'string' },
      },
      required: ['type', 'policy'],
    },
    conditions: {
      type: 'array',
      items: {
        type: 'object',
        properties: {
          type: { type: 'string' },
          op: { type: 'string' },
          value: { type: 'integer' },
        },
        required: ['type', 'op', 'value'],
      },
    },
    description: { type: 'string' },
    enabled: { type: 'boolean' },
    ruleId: { type: ['string', 'null'] },
    name: { type: 'string' },
    type: { type: 'string' },
    policyId: { type: 'string' },
  },
  required: ['action', 'conditions', 'description', 'enabled', 'ruleId', 'name', 'type', 'policyId'],
  additionalProperties: false,
}
